void configL(char* cx) {
	FILE* f;
	strcpy(cx, "");
	if ((f = fopen(PER_CONFIG, "r+")) == NULL) {
		return;
	}
	if (fgetc(f) == EOF) {
		color(GELBh);
		printf("Configuration File is emty!!\n");
		printf("Do you want to auto generate the document? (y/n)\n");
		rcolor;
		if ('y' == _getch()) {
			generateC(f);
			fclose(f);
			system(PER_CONFIG);
			configL(cx);
			return;
		}
		else
		{
			fclose(f);

			return;
		}
	}
	rewind(f);
	int i = 0;
	char b[12] = "";
	char c = 0;

	fscanf(f, "%i %s", &i, b);
	//printf("DATA: %i, %s\n", i, b);
	if (i) {
		strcat(cx, " ");
		strcat(cx, b);
	}
	do {
		while ((c = fgetc(f)) != '\n' && c != EOF);
		if (c != EOF) {
			fscanf(f, "%i %s", &i, b);
			//printf("DATA: %i, %s\n", i, b);
			if (i == 1) {
				strcat(cx, " ");
				strcat(cx, b);
			}
			i = 0;
		}
	} while (c != EOF);
	fclose(f);

	if (cx[0] == '\0') {
		printf("Nothing is selected in configuration file!!\n");
		printf("Do you want to auto generate the document? (y/n)\n");
		if ('y' == _getch()) {
			f = fopen(PER_CONFIG, "w+");
			generateC(f);
			fclose(f);
			system(PER_CONFIG);
			configL(cx);
			return;
		}
	}
	//close();
	if (f != NULL)
		fclose(f);
}

